import { useState } from 'react'

const ListRender = () => {
  const [list] = useState(["João","Pedro","José"])
  const [users] = useState([
    {id: 46, name: "João", age: 65},
    {id: 54, name: "Pedro", age: 35},
    {id: 33,name: "José", age: 54},
    {id: 51, name: "Matheus", age: 74}
  ])

  return (
    <div>
      <ul>
        {list.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>

      <ul>
        {users.map((user) => (
          <li key={user.id}>
            {user.name} - {user.age}
          </li>
        ))}
      </ul>

      <button>Delete Some User</button>
    </div>
  )
}

export default ListRender
